INSERT INTO `game_posts` (`id`, `title`, `genres`, `status`, `linkreguli`, `linkjoc`) VALUES
(1, 'Monopoly', 'http://localhost/ci/img/monopoly2.jpg', 'Telul jocului Monopoly este de a deveni cel mai bogat jucator prin cumpararea, inchirierea si vanzarea proprietatilor imobiliare.\r\nJocul Monopoly este cel mai bine vandut joc din categoria sa, fiind comercializat  in 103 tari si in 37 de limbi . Dar cum a fost creat Monopoly ? Cand a inceput acest joc sa fie creat ?</br>\r\n\r\nMonopoly a aparut in anul 1934, in timpul Marii Crize din SUA, cand Charles B. Darrow din Germantown, Pennsylvania, si-a aratat creatia, denumita de el jocul Monopoly catre conducerea firmei producatoare de jucarii Parker Brothers . Va vine sa credeti aceasta a respins  acest joc pe motiv ca prezinta prea multe erori de design ?</br>\r\n\r\nDar Darrow nu s-a lasat descurajat si, desi era ca si multi alti americani, somer, el s-a gandit sa produca acest joc pe cont propriu. Zis si facut : impreuna cu un prieten a produs peste 5000 de copii ale acestui joc pe care le-a vandut prin intermediul unui magazin de jucarii din Philadelphia . Jocul a avut un success imediat.', 'http://www.cumsejoaca.ro/reguli-de-joc-regulament/jocuri-de-masa/boardgames/monopoly-regulament-de-j', 'https://www.marmaladegamestudio.com/games/monopoly/'),
(2, 'Remi', 'http://localhost/ci/img/remi.jpg    ', 'Obiectivul jocului este de a aduna piese care sa formeze grupuri valide (suite si formatii) ce vor putea fi apoi etalate (coborate pe masa cu fata in sus). Inainte de a face orice, un jucator trebuie sa inceapa tura tragand o piesa. Apoi, daca jucatorul are combinatii potrivite pe tabla, poate sa le coboare pe masa. In finalul turei jucatorul trebuie sa arunce o piesa cu fata in sus. Piesele aruncate se aseaza una dupa alta in sir, in ordinea in care au fost date jos. Piesa aruncata de primul jucator e asezata pe \"orizontala\" in partea stanga sus si indica inceputul sirului de piese aruncate. Acea piesa nu va putea fi trasa niciodata.', 'https://www.remi-online.ro/reguli-remi-etalat.php#', ''),
(3, 'Yams sau Yatzy', 'http://localhost/ci/img/yamss.jpg', 'Yams sau Yatzy este un joc de zaruri creat de Milton Bradley. Ideea provine din jocuri anterioare precum Yacht si Generala. În joc sunt folosite câte cinci zaruri, urmarind completarea unui tabel prestabilit, scopul fiind de a avea un punctaj cât mai mare. Yams este un joc de societate caracterizat de noroc, strategie, probabilitate, atentie distributiva.Ideea provine din jocuri anterioare precum Yacht si Generala. In joc sunt folosite cate cinci zaruri, urmarind completarea unui tabel prestabilit, scopul fiind de a avea un punctaj cat mai mare. Yams este un joc de societate caracterizat de noroc, strategie, probabilitate si atentie distributiva.', 'http://www.cumsejoaca.ro/tag/yatzy/', ''),
(4, 'Uno', 'http://localhost/ci/img/uno1.jpg', 'Din ce in ce mai cunoscut si in Romania, jocul de carti UNO se joaca in 2 pana la 10 jucatori. Este un joc pentru cei cu varste peste 7 ani, iar scopul lui este de a obtine 500 de puncte si de a scapa de toate cartile sau de a ramane cu cat mai putine in mana cand se termina o tura.Fiecare jucator primeste 7 carti, iar cele ramase se aseaza intr-un teanc cu fata in jos, pentru tragere. Prima carte din teanc este intoarsa pentru ca jocul sa poata incepe.\r\nPrimul jucator care da jos trebuie sa dea o carte care sa se potriveasca fie cu numarul, fie cu culoarea cartii de jos. De exemplu, daca jos este un 7 rosu, jucatorul trebuie sa dea orice carte rosie sau un 7 de orice culoare. Sau jucatorul poate pune jos o carte neagra cu care sa schimbe culoarea.\r\nDaca urmatorul jucator nu are ce sa dea, nimic care sa se potriveasca cu ce e jos, trebuie sa traga o carte din gramada de jos. Poate sa puna acea carte jos, daca se potriveste, fara sa isi astepte randul (cu conditia ca urmatorul jucator sa nu fi pus deja o carte jos).\r\n\r\nCand ramai cu o singura carte in mana, trebuie sa spui \"UNO\" imediat – ca la Septica Americana. Daca uiti, trebuie sa tragi doua carti de jos, drept pedeapsa. Asta daca esti prins de ceilalti jucatori.\r\n\r\n\r\n\r\nCand un jucator ramane fara carti, jocul se termina. Punctele se aduna si jocul poate incepe din nou.\r\n', 'https://www.roportal.ro/articole/despre/cum_se_joaca_uno_reguli_de_joc_3042/', ''),
(5, 'Jenga', 'http://localhost/ci/img/jenga.jpg', 'Jenga este un joc de petrecere, foarte simplu in ce priveste regulamentul, necesita o oarecare indemanare si atentie. In continuare o sa va prezint editia scoasa de Hasbro si importata de Noriel.\r\nOBIECTIV:Scoate cate un bloc din turn, apoi pune-l in varf.\r\nUltimul jucator care pune un bloc in varf fara ca turnul sa cada castiga!\r\nPREGATIRE\r\n– Pune toate blocurile pe o suprafata plata.\r\n– Unul dintre jucatori foloseste suportul pentru a construi turnul, asezand straturi de cate trei blocuri, fixate la un unghi corect unul fata de celalalt. La sfarsit vei obtine un turn solid cu 18 etaje, care se poate dubla in timpul jocului!\r\n– Asaza cu grija suportul in pozitie verticala, apoi indeparteaza-l, astfel incat turnul sa poata sta in picioare singur.', 'https://www.boardgames-blog.ro/board-games/jenga-review-si-regulament-in-limba-romana/', ''),
(6, 'Catan', 'http://localhost/ci/img/catan.jpg', 'Colonistii din Catan este un joc cunoscut si apreciat la nivel mondial, existand inclusiv campionate la acest nivel. Jocul are o harta modulara, care difera de fiecare data cand joci, iar scopul e sa fii primul care aduna 10 puncte. Harta e compusa din hexagoane pe care sunt ilustrate resurse, iar pe fiecare hexagon sunt numere ce indica de fapt o suma de zaruri. \r\n\r\nAtunci cand iti vine randul, arunci cu zarurile, iar toata lumea care are o constructie (asezare sau oras) intr-un loc adiacent cu numarul indicat de suma zarurilor tale va primi o resursa din locul respectiv. Pentru a te putea dezvolta si pentru a aduna puncte, trebuie sa iti construiesti cat mai multe drumuri, asezari, orase, sa tragi carti de dezvoltare, iar toate acestea pot fi realizate doar prin combinatii de resurse. Pentru a putea avea cat mai des combinatiile de resurse potrivite ajungi sa le propui adversarilor schimburi, iar negocierea este nelipsita in aceste situatii.', 'http://www.regatuljocurilor.ro/product_extra_files/CatanOrase.pdf', ''),
(7, 'Activity', 'http://localhost/ci/img/activity.jpg', 'Jocul Activity - Este un joc de comunicare, de societate care poate fi jucat in familie sau cu prietenii. Ca si renumitul joc de societate Sarade, in care jucatorii trebuie sa isi comunice ideile unul altuia. Interpretarea acestor notiuni reprezinta o adevarata provocare pentru jucatori! Totul este posibil inseamna pe de o parte ca notiunea cautata poate sa fie un simplu cuvant, sau un dicton, sau pot aparea chiar onomatopee. Mai inseamna si ca cel care „interpreteaza” notiunea poate alege simultan mai multe moduri de exprimare. Un nou mod de exprimare a notiunilor cautate: prin sunete. Jucatorul poate reda aceste sunete specifice cu ajutorul obiectelor din preajma, sau folosindu-se de partile propriului corp.', 'https://cumsejoaca.files.wordpress.com/2019/03/regulament-activity.pdf', ''),
(8, 'Sah', 'http://localhost/ci/img/sah.jpg', 'Regulile jocului de sah sunt reguli care guverneaza modul de a juca sah. In timp ce originile exacte ale sahului sunt neclare, regulile moderne au fost luate mai intai din Italia in timpul secolului al saisprezecelea. Regulile au continuat a fi usor modificate pana la inceputul secolului al nouasprezecelea, cand ele au ajuns la forma curenta. Regulile de asemenea variau din loc in loc. Azi Federatia Internationala de Sah (FIDE), cunoscuta de asemenea ca Organizatia Internationala de Sah, stabileste regulile standard, cu modificari neinsemnate facute de unele organizatii nationale pentru propriile lor obiective. Schimbari mici de reguli exista si la sahul blitz, sahul prin corespondenta, sahul online si variantele de sah.\r\n\r\nSahul este un joc jucat de doua persoane pe o tabla de sah, cu 32 piese (cate 16 pentru fiecare jucator) de sase tipuri. Fiecare tip de piesa este mutata pe tabla intr-un mod diferit. Scopul jocului este de a da mat, adica de a ataca regele in asa fel incat capturarea sa sa fie inevitabila. Jocul nu trebuie neaparat sa se termine cu mat — jucatorii pot si ceda, daca cred ca vor pierde. In plus exista diferite cai de a termina jocul cu remiza (egalitate).', 'https://www.chess.com/ro/sah-reguli', ''),
(9, 'Tintar', 'http://localhost/ci/img/tintar.jpg', 'Jocul are o lunga traditie atat in Europa cat si in afara ei. Doua desene ale tablei de joc, sub forma de graffiti, au fost gasite în templul Ramesseum din Kurna, Egipt, datand aproximativ din 1440 i. de Hr. si se crede ca Egiptul este tara de originie a tintarului.\r\nDescoperirile efectuate în pesterile din acest defileu arata ca zona a fost locuita din timpul ultimei glaciatiuni, dar piatra cu tabla de tintar nu a fost inca datata.\r\nLa începutul partidei tabla de joc este goala. Jocul se desfasoara in doua etape:\r\n\r\nIn prima etapa jucatorii pun pe rand cate una din piesele proprii pe punctele tablei de joc. Aceasta etapa se incheie cand sunt plasate pe tabla toate cele 18 piese.\r\nIn a doua etapa jucatorii muta pe rand cate una din piesele proprii. Jucatorul care incepe jocul este decis fie de comun acord, fie de exemplu prin aruncarea unui zar, fie cel care joaca cu piesele mai deschise la culoare.\r\n\r\nScopul urmarit de fiecare jucator este de a elimina una cate una piesele adversarului. Pierde jucatorul care fie ajunge sa aiba numai doua piese, fie sa nu-si mai poata muta nicio piesa.', 'http://www.cumsejoaca.ro/reguli-de-joc-regulament/regulile-jocului-de-moara-tintar/', '');

